class Solution {
    func findMinimumOperations(_ s1: String, _ s2: String, _ s3: String) -> Int {
        let arr1 = Array(s1), arr2 = Array(s2), arr3 = Array(s3)
        var i = arr1.count, j = arr2.count, k = arr3.count
        var operations = 0

        while i > 0 && j > 0 && k > 0 {
            if arr1[i-1] == arr2[j-1] && arr2[j-1] == arr3[k-1] {
                i -= 1
                j -= 1
                k -= 1
            } else {
                break
            }
        }

        if i == 0 && j == 0 && k == 0 {
            return 0
        }

        while i > 0 || j > 0 || k > 0 {
            if i > 0 && (j <= 0 || arr1[i-1] != arr2[j-1]) && (k <= 0 || arr1[i-1] != arr3[k-1]) {
                i -= 1
                operations += 1
            } else if j > 0 && (i <= 0 || arr2[j-1] != arr1[i-1]) && (k <= 0 || arr2[j-1] != arr3[k-1]) {
                j -= 1
                operations += 1
            } else if k > 0 && (i <= 0 || arr3[k-1] != arr1[i-1]) && (j <= 0 || arr3[k-1] != arr2[j-1]) {
                k -= 1
                operations += 1
            } else {
                break
            }
        }

        if i > 0 || j > 0 || k > 0 {
            return -1
        }

        return operations
    }
}
